import React from "react";
import { FlatList, Text } from "react-native";

const ShowSearchPreview = ({ previewFood }) => {

	return (
		<>
			<FlatList data={[
          {key: 'Devin'},
          {key: 'Dan'},
          {key: 'Dominic'},
          {key: 'Jackson'},
          {key: 'James'},
          {key: 'Joel'},
          {key: 'John'},
          {key: 'Jillian'},
          {key: 'Jimmy'},
          {key: 'Julie'},
        ]} renderItem={(item) => <Text>{item.key}</Text>} />
		</>
	);
}

export default ShowSearchPreview;
